  "translationLines": [
    {
      "lineNumber": 231992,
      "originalJapaneseLine": "「そういう上昇志向、よく似てるわ……",
      "translatedEnglishLine": "\"That kind of ambition to rise up, it's very similar...\""
    },
    {
      "lineNumber": 231993,
      "originalJapaneseLine": "　いや、でもあの馬鹿は、",
      "translatedEnglishLine": "No, but that idiot,"
    },
    {
      "lineNumber": 231994,
      "originalJapaneseLine": "　もらえるものはなんでももらってたか」",
      "translatedEnglishLine": "was taking everything he could get.\""
    },
    {
      "lineNumber": 231995,
      "originalJapaneseLine": "「アア？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 231996,
      "originalJapaneseLine": "「なんだ、結局利用したのは一人もいなかったのか」",
      "translatedEnglishLine": "\"What, in the end, no one was actually used?\""
    },
    {
      "lineNumber": 231997,
      "originalJapaneseLine": "「君達には少し早かったかな？」",
      "translatedEnglishLine": "\"Maybe it was a little too soon for you all?\""
    },
    {
      "lineNumber": 231998,
      "originalJapaneseLine": "「まあ、何事も経験。",
      "translatedEnglishLine": "\"Well, everything is an experience."
    },
    {
      "lineNumber": 231999,
      "originalJapaneseLine": "　なにもしない経験、という経験が積めたなら、",
      "translatedEnglishLine": "If you've gained the experience of doing nothing,"
    },
    {
      "lineNumber": 232000,
      "originalJapaneseLine": "　それはそれでいいさ」",
      "translatedEnglishLine": "then that's fine in its own way.\""
    },
    {
      "lineNumber": 232001,
      "originalJapaneseLine": "「アームズ様」",
      "translatedEnglishLine": "\"Lord Arms.\""
    },
    {
      "lineNumber": 232002,
      "originalJapaneseLine": "「おや？」",
      "translatedEnglishLine": "\"Oh?\""
    },
    {
      "lineNumber": 232003,
      "originalJapaneseLine": "「日光様がお戻りになられました」",
      "translatedEnglishLine": "\"Lord Nikkou has returned.\""
    },
    {
      "lineNumber": 232004,
      "originalJapaneseLine": "ボーイがうやうやしく日本刀を",
      "translatedEnglishLine": "The boy respectfully handed the katana"
    },
    {
      "lineNumber": 232005,
      "originalJapaneseLine": "アームズに手渡した。",
      "translatedEnglishLine": "to Arms."
    },
    {
      "lineNumber": 232006,
      "originalJapaneseLine": "「ああ、ありがとう」",
      "translatedEnglishLine": "\"Ah, thank you.\""
    },
    {
      "lineNumber": 232007,
      "originalJapaneseLine": "「日光、どうだった？",
      "translatedEnglishLine": "\"Nikkou, how was it?"
    },
    {
      "lineNumber": 232008,
      "originalJapaneseLine": "　私がいなくなった後――」",
      "translatedEnglishLine": "After I was gone—\""
    },
    {
      "lineNumber": 232009,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 232010,
      "originalJapaneseLine": "「おや、機嫌が悪そうだな。",
      "translatedEnglishLine": "\"Oh my, you seem to be in a bad mood."
    },
    {
      "lineNumber": 232011,
      "originalJapaneseLine": "　サービスに不備でもあったのかい？」",
      "translatedEnglishLine": "Was there some deficiency in the service?\""
    },
    {
      "lineNumber": 232012,
      "originalJapaneseLine": "「出来うる限りのことはさせて頂きましたが……",
      "translatedEnglishLine": "\"I did everything within my ability..."
    },
    {
      "lineNumber": 232013,
      "originalJapaneseLine": "　お気に召して頂けなかったのなら残念です」",
      "translatedEnglishLine": "If you were not pleased, that is regrettable.\""
    },
    {
      "lineNumber": 232014,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 232015,
      "originalJapaneseLine": "「貴女という人は……はあ……」",
      "translatedEnglishLine": "\"You really are a person who... sigh...\""
    },
    {
      "lineNumber": 232016,
      "originalJapaneseLine": "「なんだ日光も同意してくれたと思っていたが」",
      "translatedEnglishLine": "\"I thought Nikkou agreed with me too.\""
    },
    {
      "lineNumber": 232017,
      "originalJapaneseLine": "「万事において強引すぎます。",
      "translatedEnglishLine": "\"You are too forceful in everything."
    },
    {
      "lineNumber": 232018,
      "originalJapaneseLine": "　少しは段階というものを……」",
      "translatedEnglishLine": "You should consider some kind of steps...\""
    },
    {
      "lineNumber": 232019,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 232020,
      "originalJapaneseLine": "「いえ、もう結構です」",
      "translatedEnglishLine": "\"No, that's enough.\""
    },
    {
      "lineNumber": 232021,
      "originalJapaneseLine": "「参ったね。",
      "translatedEnglishLine": "\"I'm beaten."
    },
    {
      "lineNumber": 232022,
      "originalJapaneseLine": "　今までで一番ご機嫌斜めだ」",
      "translatedEnglishLine": "This is the grumpiest I've ever seen.\""
    },
    {
      "lineNumber": 232023,
      "originalJapaneseLine": "「まあ、力が戻ったのならなんでもいいさ」",
      "translatedEnglishLine": "\"Well, as long as your strength has returned, it doesn't matter.\""
    },
    {
      "lineNumber": 232024,
      "originalJapaneseLine": "「はいはいはい！　それ、聖刀日光でしょ？",
      "translatedEnglishLine": "\"Yes, yes, yes! That's the sacred sword Nikkou, right?"
    },
    {
      "lineNumber": 232025,
      "originalJapaneseLine": "　持ちたい持ちたい！」",
      "translatedEnglishLine": "I want to hold it, I want to hold it!\""
    },
    {
      "lineNumber": 232026,
      "originalJapaneseLine": "「日光を？」",
      "translatedEnglishLine": "\"Nikkou?\""
    },
    {
      "lineNumber": 232027,
      "originalJapaneseLine": "アームズは考えるような間を開けてから、",
      "translatedEnglishLine": "Arms paused as if thinking,"
    },
    {
      "lineNumber": 232028,
      "originalJapaneseLine": "少しだけイタズラっぽい笑みを浮かべて",
      "translatedEnglishLine": "then gave a slightly mischievous smile"
    },
    {
      "lineNumber": 232029,
      "originalJapaneseLine": "レリコフに手渡した。",
      "translatedEnglishLine": "and handed it to Lerikoff."
    },
    {
      "lineNumber": 232030,
      "originalJapaneseLine": "「……構わないが、気をつけろ」",
      "translatedEnglishLine": "\"...I don't mind, but be careful.\""
    },
    {
      "lineNumber": 232031,
      "originalJapaneseLine": "「気をつけろ？」",
      "translatedEnglishLine": "\"Be careful?\""
    },
    {
      "lineNumber": 232032,
      "originalJapaneseLine": "首を傾げながら、",
      "translatedEnglishLine": "Tilting his head,"
    },
    {
      "lineNumber": 232033,
      "originalJapaneseLine": "レリコフが日光を鞘から抜いた途端――",
      "translatedEnglishLine": "the moment Lerikoff drew Nikkou from its sheath—"
    },
    {
      "lineNumber": 232034,
      "originalJapaneseLine": "「ぴぎゅん！？」",
      "translatedEnglishLine": "\"Pigyunn!?\" (a surprised sound)"
    },
    {
      "lineNumber": 232035,
      "originalJapaneseLine": "「び、びりっとした！？",
      "translatedEnglishLine": "\"It, it shocked me!?"
    },
    {
      "lineNumber": 232036,
      "originalJapaneseLine": "　なにこれ！？　なにこれ！？」",
      "translatedEnglishLine": "What is this!? What is this!?\""
    },
    {
      "lineNumber": 232037,
      "originalJapaneseLine": "「はっはっはっ、そうだろうな」",
      "translatedEnglishLine": "\"Ha ha ha, I thought so.\""
    },
    {
      "lineNumber": 232038,
      "originalJapaneseLine": "「日光を扱うには特別な儀式……",
      "translatedEnglishLine": "\"To wield Nikkou, a special ritual is required..."
    },
    {
      "lineNumber": 232039,
      "originalJapaneseLine": "　ふっ、そうだな、修行が必要なんだ」",
      "translatedEnglishLine": "Hmph, yes, training is necessary.\""
    },
    {
      "lineNumber": 232040,
      "originalJapaneseLine": "「君にはまだ早い。",
      "translatedEnglishLine": "\"It's still too soon for you."
    },
    {
      "lineNumber": 232041,
      "originalJapaneseLine": "　特にここに来て何もしない人には、ね」",
      "translatedEnglishLine": "Especially for those who come here and do nothing, you see.\""
    },
    {
      "lineNumber": 232042,
      "originalJapaneseLine": "「アア？　どういう意味だそれは」",
      "translatedEnglishLine": "\"Huh? What do you mean by that?\""
    },
    {
      "lineNumber": 232043,
      "originalJapaneseLine": "「言葉通りの意味だよ」",
      "translatedEnglishLine": "\"Just the literal meaning.\""
    },
    {
      "lineNumber": 232044,
      "originalJapaneseLine": "「おもしれーじゃねーか！",
      "translatedEnglishLine": "\"Isn't that interesting!"
    },
    {
      "lineNumber": 232045,
      "originalJapaneseLine": "　おい、それ俺にも持たせろ！」",
      "translatedEnglishLine": "Hey, let me hold it too!\""
    },
    {
      "lineNumber": 232046,
      "originalJapaneseLine": "「あばばばばばばばば！？」",
      "translatedEnglishLine": "\"Ababababababa!?\" (crying or shocked sound)"
    },
    {
      "lineNumber": 232047,
      "originalJapaneseLine": "即、ザンスはビリビリ状態になった。",
      "translatedEnglishLine": "Immediately, Zans was in a state of electric shock."
    },
    {
      "lineNumber": 232048,
      "originalJapaneseLine": "「はっ！　がっ！　ぎっ！",
      "translatedEnglishLine": "\"Hah! Gah! Gih!"
    },
    {
      "lineNumber": 232049,
      "originalJapaneseLine": "　ど、どーーっだ！　持てたぞぞぞぞ！」",
      "translatedEnglishLine": "Take that! I held it! Zozoxo!\""
    },
    {
      "lineNumber": 232050,
      "originalJapaneseLine": "「無理すんな！？",
      "translatedEnglishLine": "\"Don't overdo it!?"
    },
    {
      "lineNumber": 232051,
      "originalJapaneseLine": "　お前感電死すんぞ！？」",
      "translatedEnglishLine": "You'll die from electric shock!?"
    }
  ]
}

